import React from "react";
import { BrowserRouter, Switch, Route, Link } from "react-router-dom";
import Ingreso from "./logout/ingreso";
import Registro from "./logout/registro";

function Menu(prop){
        return (
            <BrowserRouter>
                <nav>
                    <ul>
                        <Link to="/"><button>Registrar</button></Link>
                        <Link to="/Loggin"><button>Ingresar</button></Link>
                    </ul>
                </nav>
                <Switch>
                    <Route path="/" component={<Registro/>}/>
                    <Route path="/Loggin" component={<Ingreso/>}/>
                </Switch>
            </BrowserRouter>    
        )
    }


export default Menu;
